import React from 'react';
import '../../index.css';
import { Switch, Route } from 'react-router-dom';

// Import the components referenced in the routeList
import Home from '../Home';
import Login from './Login';
import Profile from './Profile';
import About from './About';
import Blog from './Blog';
import Clothes from './Clothes';
import Requests from '../Requests/Requests';

export default function Main() {
  function genAllRoutes(routeList) {
    const allRoutes = routeList.map((routeString, index) => (
      <Route
        key={index}
        exact
        path={routeString === 'Home' ? '/' : `/${routeString.toLowerCase()}`}
        component={eval(routeString)} // Use the component directly
      />
    ));
    return allRoutes;
  }

  return (
    <div className="main-container">
      <Switch>{genAllRoutes(['Home', 'Login', 'Profile', 'About', 'Blog', 'Clothes', 'Requests'])}</Switch>
    </div>
  );
}
